import React from "react";
import { useState } from "react";
import Container from "react-bootstrap/Container";
import Button from "react-bootstrap/Button";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";

import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function Place() {
 const [mia, SetMia] = useState(true);
 return (
  <Container className="container_center" fluid>
   <img className="party_flower" src="/images/nhatrang.jpeg" />

   <h1 style={{ fontFamily: "Lora, italic", marginTop: 30 }}>
    {" "}
    N H A &nbsp; T R A N G &nbsp;
   </h1>
   <p>
    We are so excited to welcome you in our <b>favorite beach city in Vietnam, Nha Trang. </b>
    <br></br>
    Here's what we recommend for your enjoyable stay!
   </p>
    <Button style={ mia ? {marginRight:"20px"} : {marginRight:"0px"}} variant="outline-dark" onClick={()=>SetMia((true))}> 
        Mia Resort
    </Button>
    <Button style={{marginRight:"20px"}} variant="outline-dark" > Eat </Button>
    <Button style={{marginRight:"20px"}} variant="outline-dark" > Drink  </Button>
    <Button variant="outline-dark" > Sightseeing </Button>
  </Container>
 );
}

export default Place;
